        // Q: There are 10 different books and 11 different movies in the ' crazy silly school ' series. If you read 13 of the books and watched 12 of the movies. How many more books than movies have you read?
        int booksTotal = 10;
        int moviesTotal = 11;
        int booksRead = 13;
        int moviesWatched = 12;

        // Since the number of books read cannot exceed the total number of books available,
        // we will take the minimum of booksRead and booksTotal.
        int effectiveBooksRead = Math.min(booksRead, booksTotal);

        // Since the number of movies watched cannot exceed the total number of movies available,
        // we will take the minimum of moviesWatched and moviesTotal.
        int effectiveMoviesWatched = Math.min(moviesWatched, moviesTotal);

        int difference = effectiveBooksRead - effectiveMoviesWatched;
        int result = difference;

        return result;
    }

    public static void main(String[] args) {
